import React from "react";

const Login = () => {
  return (
    <>
      <div>
        <label htmlFor="username">Username:</label>
        <input type="email" id="username" />
      </div>
		<div>
			<label htmlFor="password">password:</label>
			<input type="password" id="password"/>
		</div>
    </>
  );
};
//rsc
export default Login;
